      x.BREAK_EFFICIENCY_BOOST += combatBuffsBREAK_EFFICIENCY;

      //

      x.ATK += x.ATK_P * baseATK;
      x.DEF += x.DEF_P * baseDEF;
      x.HP += x.HP_P * baseHP;
      x.SPD += x.SPD_P * baseSPD;

      evaluateDependenciesSPD(p_x, p_state);
